// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Charity {
    address public owner;
    
    // Struct for holding charity information
    struct CharityInfo {
        string name;            // Name of the charity
        uint256 totalDonations; // Total donations received by the charity
    }

    mapping(address => uint256) public userDonations; // Tracks user donations
    mapping(uint256 => CharityInfo) public charities; // Tracks different charity names
    uint256 public charityCount = 0;                  // Tracks total number of registered charities

    event DonationMade(address indexed donor, uint256 indexed charityId, uint256 amount);
    event CharityAdded(uint256 indexed charityId, string name);
    event Withdrawn(address indexed owner, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can call this function.");
        _;
    }

    constructor() {
        owner = msg.sender; // Set the contract owner
    }

    // Function to add a new charity
    function addCharity(string memory _name) public onlyOwner {
        charities[charityCount] = CharityInfo({
            name: _name,
            totalDonations: 0
        });
        emit CharityAdded(charityCount, _name);
        charityCount++;
    }

    // Donate to a specific charity
    function donate(uint256 _charityId) public payable {
        require(_charityId < charityCount, "Charity does not exist.");
        require(msg.value > 0, "Donation must be greater than 0.");

        userDonations[msg.sender] += msg.value; // Track donations per user
        charities[_charityId].totalDonations += msg.value; // Track donations per charity

        emit DonationMade(msg.sender, _charityId, msg.value);
    }

    // Retrieve total donations made by a user
    function getUserDonations(address _user) public view returns (uint256) {
        return userDonations[_user];
    }

    // Retrieve total donations made to a specific charity
    function getCharityDonations(uint256 _charityId) public view returns (uint256) {
        require(_charityId < charityCount, "Charity does not exist.");
        return charities[_charityId].totalDonations;
    }

    // Withdraw funds (only owner)
    function withdraw(uint256 _amount) public onlyOwner {
        require(address(this).balance >= _amount, "Insufficient contract balance.");
        payable(owner).transfer(_amount);
        emit Withdrawn(owner, _amount);
    }

    // Get contract balance
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

